import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";
import Button from "react-bootstrap/Button";
import { NavLink } from "react-router-dom";
import {
  MDBContainer,
  MDBCol,
  MDBRow,
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBCardText,
  MDBListGroup,
  MDBListGroupItem,
  MDBProgress,
  MDBProgressBar,
  MDBIcon,
} from "mdb-react-ui-kit";

export default function Details() {
    const { id } = useParams();
    const [status, setStatus] = useState({});
    const [customer, setCustomer] = useState({});
    const [loading, setLoading] = useState(true);

    const fetchData = async () => {
      try {
        const response = await axios.get(`http://localhost:3001/loan/${id}`);
        setStatus(response.data);

        const customerNo = response.data.customerId;

        const responseCustomer = await axios.get(
          `http://localhost:3001/customer/${customerNo}`
        );

        setCustomer(responseCustomer.data);
        setLoading(false);
      } catch (error) {
        console.error("Error:", error);
      }
    };

    useEffect(() => {
      fetchData();
    }, [id]);
  if (loading) {
    return <p>Loading...</p>;
  }

  return (

    <section style={{ backgroundColor: "#eee" }}>

      <MDBContainer className="py-5">
      <div div className="text-end">
  <Button variant="success">
          <NavLink to={`/updateLoan/${id}`} className="text-decoration-none text-light">
            Update Loan Status
          </NavLink>
        </Button>
  </div>
        <MDBRow>
          <MDBCol lg="4">
            <MDBCard className="mb-4">
              <MDBCardBody className="text-center">
                <MDBCardImage
                  src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-chat/ava3.webp"
                  alt="avatar"
                  className="rounded-circle"
                  style={{ width: "150px" }}
                  fluid
                />
                <p className="text-muted mb-1">{status.customerId}</p>
                <p className="text-muted mb-4">{customer.name}</p>
                <div className="d-flex justify-content-center mb-2">
                  <MDBIcon
                    fab
                    icon="github fa-lg"
                    style={{ color: "#333333" }}
                  />
                  <MDBCardText>{status.github}</MDBCardText>
                </div>
                <div className="d-flex justify-content-center mb-2">
                  <MDBIcon
                    fab
                    icon="twitter fa-lg"
                    style={{ color: "#55acee" }}
                  />
                  <MDBCardText>{status.twitter}</MDBCardText>
                </div>
              </MDBCardBody>
            </MDBCard>
          </MDBCol>
          <MDBCol lg="8">
            <MDBCard className="mb-4">
              <MDBCardBody>
                <MDBRow>
                  <MDBCol sm="3">
                    <MDBCardText>Loan ID</MDBCardText>
                  </MDBCol>
                  <MDBCol sm="9">
                    <MDBCardText className="text-muted">{status.loanId}</MDBCardText>
                  </MDBCol>
                </MDBRow>
                <hr />
                <MDBRow>
                  <MDBCol sm="3">
                    <MDBCardText>Email</MDBCardText>
                  </MDBCol>
                  <MDBCol sm="9">
                    <MDBCardText className="text-muted">example@example.com</MDBCardText>
                  </MDBCol>
                </MDBRow>
                <hr />
                <MDBRow>
                  <MDBCol sm="3">
                    <MDBCardText>Phone</MDBCardText>
                  </MDBCol>
                  <MDBCol sm="9">
                    <MDBCardText className="text-muted">(097) 234-5678</MDBCardText>
                  </MDBCol>
                </MDBRow>
                <hr />
                <MDBRow>
                  <MDBCol sm="3">
                    <MDBCardText>Mobile</MDBCardText>
                  </MDBCol>
                  <MDBCol sm="9">
                    <MDBCardText className="text-muted">(098) 765-4321</MDBCardText>
                  </MDBCol>
                </MDBRow>
                <hr />
                <MDBRow>
                  <MDBCol sm="3">
                    <MDBCardText>Address</MDBCardText>
                  </MDBCol>
                  <MDBCol sm="9">
                    <MDBCardText className="text-muted">Bay Area, San Francisco, CA</MDBCardText>
                  </MDBCol>
                </MDBRow>
              </MDBCardBody>
            </MDBCard>
            {/* Add Project Status section here */}
          </MDBCol>
        </MDBRow>
      </MDBContainer>
    </section>
  );
}
